{{ (() => {
  const consultas = $('Aggregate6').item.json.Consulta;

  // Mapeia os índices com os campos corretos: Protesto ou Serasa
  const campos = {
    1: 'Protesto',
    2: 'Serasa',
    3: 'Protesto',
    4: 'Protesto',
    5: 'Protesto',
    6: 'Protesto',
    7: 'Protesto'
  };

  const partes = [];

  // Percorre os índices definidos
  for (let i = 1; i <= 7; i++) {
    const campo = campos[i];
    const conteudo = consultas[i]?.[campo];

    if (conteudo && conteudo.trim() !== "_Sem pendências registradas._") {
      const textoLimpo = conteudo
        .replace(/_ /g, '_')       // remove sublinhado com espaço
        .replace(/[*_]/g, '')      // remove asteriscos e underlines
        .trim();

      partes.push(textoLimpo);
    }
  }

  // Se não houver conteúdo válido, retorna string vazia (sem quebras de linha)
  if (partes.length === 0) return '';

  // Junta os blocos com separador entre eles e adiciona traço final
  return partes.join('\n\n----------------\n\n') + '\n\n----------------';
})() }}

